// index.js
import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router } from "react-router-dom";
import App from "./App";
import './components/' // Import DarkMode.css here

ReactDOM.render(
  <Router>
    <App />
  </Router>,
  document.getElementById("root")
);
